import React, { useState, useEffect } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route, Link
} from 'react-router-dom';
import Home from './Home';
import About from './About';
import Ads from './Ads';
import Register from './Register';
import Login from './Login';
import SeekingHome from './SeekingHome';
import CreateAd from './CreateAd';
import UserProfile from './UserProfile';
import './App.css';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [user, setUser] = useState(null);

  useEffect(() => {
    try {
      const storedUser = localStorage.getItem('user');
      const storedToken = localStorage.getItem('token');
      if (storedUser && storedToken) {
        setUser(JSON.parse(storedUser));
        setIsAuthenticated(true);
      }
    } catch (error) {
      console.error('Failed to parse user data from localStorage:', error);
    }
  }, []);

  const handleLogin = (userData, token) => {
    if (userData && token) {
      setIsAuthenticated(true);
      setUser(userData);
      localStorage.setItem('user', JSON.stringify(userData));
      localStorage.setItem('token', token);
    } else {
      console.error('Invalid user data or token');
    }
  };

  const handleLogout = () => {
    setIsAuthenticated(false);
    setUser(null);
    localStorage.removeItem('user');
    localStorage.removeItem('token');
  };

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about us">About Us</Link></li>
            <li><Link to="/ads">Ads</Link></li>
            {!isAuthenticated && <li><Link to="/register">Register</Link></li>}
            {!isAuthenticated && <li><Link to="/login">Login</Link></li>}
            {isAuthenticated && (
              <>
                <li><Link to="/userProfile">Profile</Link></li>
                <li>Welcome, {user?.username}!</li>
                <li><button onClick={handleLogout}>Logout</button></li>
              </>
            )}
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about us" element={<About />} />
          <Route path="/ads" element={<Ads />}>
            <Route path="seekingAHome" element={<SeekingHome user={user} isAuthenticated={isAuthenticated} />} />
            <Route path="newAd" element={<CreateAd user={user} />} />
          </Route>
          {!isAuthenticated && <Route path="/register" element={<Register />} />}
          {!isAuthenticated && <Route path="/login" element={<Login onLogin={handleLogin} />} />}
          {isAuthenticated && <Route path="/userProfile" element={<UserProfile user={user} />} />}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
